import React from 'react';
import monstar from './utilities/monstar.png';
import Draggable from 'react-draggable';

function AboutMe() {
  return (
    <div className="about-me">
        <h1>hi, im austin</h1>
        <p>i code from time to time. <br></br> unless generative ai wants to drive...</p>
        <Draggable onStop={(e, data) => {
            const { x, y } = data;
            const monstar = document.querySelector('.monstar');
            monstar.style.left = `${x}px`;
            monstar.style.top = `${y}px`;
        }}>
            <img src="monstar.png" alt="Monstar" className="monstar" />
        </Draggable>
    </div>
  );
}

export default AboutMe;
